import * as React from 'react';
import {ApplicationState} from "../../../store";
import SquadronModel from "../../../store/squadrons/SquadronModel";
import styled from "../../../utils/styled";
import {postNewSquadron} from "../../../store/squadrons/sagas";
import {connect} from "react-redux";
import {updateNewSquadron} from "../../../store/squadrons/actions";

interface PropsFromState {
    saving: boolean | undefined;
    squadrons: SquadronModel[];
    newSquadron: SquadronModel | undefined;
    squadronsErrors?: string;
}

interface PropsFromDispatch {
    postNewSquadron: typeof postNewSquadron;
    updateNewSquadron: typeof updateNewSquadron;
}

// Combine both state + dispatch props - as well as any props we want to pass - in a union type.
type AllProps = PropsFromState & PropsFromDispatch;

class AddSquadronBar extends React.Component<AllProps> {

    public render() {
        return (
            <Wrapper>
                <input>
                </input>
            </Wrapper>
        );
    }
}

const mapStateToProps = ({squadrons}: ApplicationState) => ({
    saving: squadrons.saving,
    squadrons: squadrons.squadrons,
    newSquadron: squadrons.newSquadron,
    squadronsErrors: squadrons.errors,
});


const mapDispatchToProps = {
    postNewSquadron,
    updateNewSquadron
};

export default connect(
    mapStateToProps,
    mapDispatchToProps,
)(AddSquadronBar);

    const Wrapper = styled('div')`
  display: block;
  width: 100%;
  font-family: ${props => props.theme.fonts.headings};
  font-size: large;
  margin-bottom: 1px;

  .input {
  width: 100%;
  height: 16px;
  background: white;
  }

`;
